import React, { Component } from 'react'
import { Form } from 'react-bootstrap';

class OurInput extends Component {

    render() {
        const{ type, name, title, choices } = this.props;

        return (
            <Form>
            {
            (type === "text" && <Form.Label>Example textarea</Form.Label>)
            ||
            (type === "dropdown" && <Form.Label>Example select</Form.Label>)
            }
            </Form>
        )
    }
}

export default OurInput;
